import React from 'react';
import styled from 'styled-components';

const NotFound = () => {

    const Wrapper = styled.div`
        height: 100%;
        padding: 0;
        margin: 0;
        display: -webkit-box;
        display: -moz-box;
        display: -ms-flexbox;
        display: -webkit-flex;
        display: flex;
        align-items: center;
        justify-content: center;
    `

    return (
        <div>Not found</div>
    )
}

export default NotFound;
